import React, { Component } from 'react'
const Clarifai = require('clarifai');

const API_KEY = '162638f1f65c49bcab90111f996d495c'
const BASE_URL = 'https://api.clarifai.com/v2/models/bd367be194cf45149e75f01d59f77ba7/outputs'
const app = new Clarifai.App({
    apiKey: API_KEY
   });

   app.models.predict("bd367be194cf45149e75f01d59f77ba7", "https://samples.clarifai.com/food.jpg").then(
    function(response) {
     console.log(response)
    },
    function(err) {
      console.log(err)
    }
  );

export default class Home extends Component {




